import { FC, ChangeEvent, useState, ReactNode, MouseEventHandler } from 'react';
import { format } from 'date-fns';
import numeral from 'numeral';
import PropTypes from 'prop-types';
import {
    TableSortLabel, SortDirection,Tooltip,Divider,Box,FormControl,InputLabel,Card,Checkbox,IconButton,Table,TableBody,TableCell,TableHead,
    TablePagination,
    TableRow,
    TableContainer,
    Select,
    MenuItem,
    Typography,
    useTheme,
    CardHeader,
    SelectChangeEvent,
    Button
} from '@mui/material';

import { DataTableRequest, DataTableResponse, Order, Column } from '../../../../models/table.type';
import DataTable from '../../../../components/DataTables';
//import BulkActions from './BulkActions';

const CompanyTypeTable: FC<any> = ({ editHandler }) => {
    const columns: readonly Column[] = [
        {
            id: 'CompanyTypeID',
            numeric: true,
            disablePadding: true,
            label: 'User Name',
            visible: false,
            searchAble: false
        },
        {
            id: 'CompanyTypeName',
            numeric: false,
            disablePadding: false,
            label: 'Company Type',
            visible: true,
            searchAble: true
        },
        {
            id: 'Remarks',
            numeric: false,
            disablePadding: false,
            label: 'Remarks',
            visible: true,
            searchAble: true
        },
    ];

    return (
        <Card>
          
            <Divider />
            <DataTable editHandler={editHandler} columns={columns} url='master/GetCompanyTypes' isSearchAble={true} />
        </Card>

    );
};

